import './ExpenseItem.css'

function ExpenseItem() {
  return (
    <div className='expense-item'>
      <div>June 22 2023</div>
      <div className='expense-item__descript'>
        <h2>Car Insurance</h2>
        <div>294.34</div>
      </div>
    </div>
  );
}
export default ExpenseItem;
